from sympy import factorial, binomial
def T(n,k):
    s=0
    for j in range(n//2 - k+1):
        s+=(-1)**j * factorial(n-k-j) * binomial(n//2 - k, j)
    return binomial(n//2, k)* s
i=0
for n in range(26):
    for k in range(n//2 + 1):
        print(str(i)+" "+str(T(n,k)))
        i+=1
